q=A.d2(A.b([A.cc(A.b(["\uacb0\uc81c \uae30\ub2a5\uc740 \ud3ec\ud2b8\uc6d0\uc744 \uc0ac\uc6a9\ud558\uc5ec \uad6c\ud604\ud588\uc2b5\ub2c8\ub2e4. \uacb0\uc81c \uc694\uccad\uc740 \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0\uc11c \ud3ec\ud2b8\uc6d0 \uacb0\uc81c \uc808\ucc28\ub97c \ud1b5\ud574 \uc9c4\ud589\ub418\uba70, \uacb0\uc81c\uac00 \uc644\ub8cc\ub418\uba74 \ud3ec\ud2b8\uc6d0\uc5d0\uc11c \ubc1b\uc740 imp_uid\ub97c \ubc31\uc5d4\ub4dc \uc11c\ubc84\ub85c \uc804\ub2ec\ud569\ub2c8\ub2e4. \uacb0\uc81c \uc870\uc791 \uac00\ub2a5\uc131\uc744 \ubc29\uc9c0\ud558\uae30 \uc704\ud574, \ubc31\uc5d4\ub4dc\ub294 imp_uid\ub97c \ud1b5\ud574 \ud3ec\ud2b8\uc6d0 \uacb0\uc81c \ub0b4\uc5ed\uc744 \uc870\ud68c\ud558\uace0 \uc8fc\ubb38 \ub0b4\uc6a9\uacfc \uacb0\uc81c \uae08\uc561\uc758 \uc720\ud6a8\uc131\uc744 \uac80\uc99d\ud558\uba70, \uc544\uc774\ud15c\uc774 \uc815\uc0c1 \ud310\ub9e4 \uc0c1\ud488\uc778\uc9c0 \ud655\uc778\ud569\ub2c8\ub2e4. \ube44\uc815\uc0c1\uc801\uc778 \uacb0\uc81c\uc778 \uacbd\uc6b0, imp_uid\ub97c \uc0ac\uc6a9\ud574 \ud3ec\ud2b8\uc6d0\uc5d0 \uacb0\uc81c \ucde8\uc18c\ub97c \uc694\uccad\ud569\ub2c8\ub2e4.","\uacb0\uc81c \uac80\uc99d\uc5d0\ub294 imp_uid\uc640 merchant_uid\ub97c \uc0ac\uc6a9\ud558\uba70, \uac80\uc99d \uc9c1\ud6c4 merchant_uid\ub97c \ub9cc\ub8cc\uc2dc\ucf1c \ub9cc\ub8cc\ub41c merchant_uid\ub97c \ub2e4\uc2dc \uc0ac\uc6a9\ud558\uc5ec \uc815\uc0c1 \uacb0\uc81c\ub97c \ucde8\uc18c\uc2dc\ud0a4\ub824\ub294 \uc545\uc758\uc801\uc778 \uc2dc\ub3c4\ub97c \ubc29\uc9c0\ud569\ub2c8\ub2e4. \uacb0\uc81c \ucde8\uc18c\ub294 \ubc31\uc5d4\ub4dc \uc11c\ubc84\uc5d0\uc11c\ub9cc \uc811\uadfc \uac00\ub2a5\ud55c REST API Secret \ud0a4\uac00 \ud544\uc694\ud558\ubbc0\ub85c, \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0\uc11c \uc774\ub97c \uc870\uc791\ud558\ub294 \uac83\uc740 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4."],l),!1,!1,"\uacb0\uc81c \ubc0f \uac80\uc99d \uc2dc\uc2a4\ud15c \uad6c\ud604",q)],e),!0,m)
